import React from 'react';
import "./style/App.css"
import AddForm from './pages/Forms/AddForm';
import Header from "./pages/Header/header"
import EditObj from "./pages/EditObject/editObj"
import { BrowserRouter, Route, Switch } from 'react-router-dom'
import ObjectList from './pages/ObjectList/objectList'

function App() {
  return (
    <BrowserRouter>
    <Header />
      <Switch>
        <Route path='/' exact component={ObjectList} />
        <Route path='/addObj' exact component={AddForm} />
        <Route path='/editObj/:id' exact component={EditObj} />
        <Route path='/' render={() => <h1>404 <br /> Page was not found!</h1>} />
      </Switch>
    </BrowserRouter>
  )
}


export default App;
